import React from "react"
import "./Projects.css"
import Col from "react-bootstrap/Col"
import Row from "react-bootstrap/Row"

const Projects: React.FC = () => {
    return (
        <div className="projects_wrapper">
            <h1>My Projects</h1>
            <Row className="cards_wrapper">
                <Col className="card">
                    <p>zoomie roomies</p>
                </Col>

                <Col className="card">
                    <p>runge kutta</p>
                </Col>
            </Row>
        </div>
    );
}

export default Projects;
